FWiW. When setting up my macbook w/ LM Studio to test local models, I had to change my OAI_CONFIG_LIST file to include the path that Docker understands as my laptop. Using http://localhost:1234/v1 didn't work as the docker image running AutoGen wouldn't recognize it as its localhost. Here's what worked for me: ```  {
        "model": "open-ai",
        "api_base": "http://host.docker.internal:1234/v1",
        "api_key": "NULL"
    } ```

